import React from 'react';
import '../header/Header.scss';
import logo from '../../assets/Logo/Logo-brainflix.svg';
import userIcon from '../../assets/Images/Mohan-muruge.jpg';



function Header() {
  return (
    <nav className="nav-bar">
      <div className="nav-bar__logo"><a href="#"><img src={logo} alt="Brainflix logo"/></a></div>
      <div className="nav-bar__input-container">
        <input type="text" className="nav-bar__input" />
      </div>
      <div className="nav-bar__account">
        <button className="nav-bar__upload-button">+ UPLOAD</button>
        <img src={userIcon} alt="User Icon" className="nav-bar__icon"/>
      </div>
    </nav>
  );
}
export default Header;
